import {Route, Router } from "react-router-dom";
import HomePage from "../HomePage";
import PostPage from "../PostPage";


const App = () => {
  return (
    <Router>
      <Route path="/" Component={HomePage} />
      <Route path="/posts" Component={PostPage} />
    </Router>
  );
}

export default App;
